window.Thunder.components["checkout-success"].template=function(t){return'<div class="thunder--checkout-success"><h2>'+t.m(t.options.type+"Success")+"</h2><p>"+t.m(t.options.type+"SuccessBody")+"</p><h3>"+t.m(t.options.type+"Info")+'</h3><table class="thunder--'+t.options.type+'-info"><tbody><tr><td>'+t.m(t.options.type+"Id")+'</td><td><span class="copy-to-id">'+t.subject._id+'</span><span class="copy-to-id-button">'+t.m("copyIdButton")+"</span></td></tr><tr><td>"+("order"===t.options.type?t.m("orderedAt"):t.m("subscribedAt"))+"</td><td>"+t.subject.createdAt.formatted+'</td></tr></tbody></table><div class="thunder--checkout-success-actions"><button class="thunder--button thunder--view-more-details">'+t.m("viewMoreDetails")+"</button></div></div>"};